import React,{useState} from 'react'
import axios from 'axios';
function Emicalcdashboard() {
    const [enrollerData,setEnrollerData]=useState({name:'',address:'',pincode:'',mobile:'',email:'',adhar_card:'',pan_card:'',loan_amount:'',intrest_rate:'',tenure:''});
    const [loan_amount,setLoanamt]=useState('');
    const [tenure,setTenureamt]=useState('');
    const [intrest_rate,setIntrestamt]=useState('');
    const [emiDetails, setEmiDetail]=useState(null);

    const calculateemi=async ()=>{
        //api\
       

       
        const responses=await axios.post(`http://localhost:8001/api/emi_info/`,{loan_amount:loan_amount,tenure:tenure,intrest_rate:intrest_rate});
        console.log(responses.data);
        setEmiDetail(responses.data);


    }
    const handleFileChange=(e)=>{
        setEnrollerData({...enrollerData,[e.target.name]:e.target.files[0]});
    }
    const handleEnrollerinfo=async ()=>{
        const dataall=new FormData();
        for(let i in dataall){
            console.log("the value of i is ",i);
            dataall.append(i,enrollerData[i]);
        }
        await axios.post(`http://localhost:8001/api/enroller_client/`, dataall);
        console.log("enroller data is",dataall);
        console.log("submit done!!!");
        
    }
  return (
    <div>
        <h1>EMI CALCULATOR DASHBOARD</h1>
        <div class="accept_input">
        <input type="number" placeholder='entre the loan amt ' value={event.target.loan_amount}  onChange={(event)=>setLoanamt(event.target.value)}/>
            <input type="number" placeholder='entre the tenure' value={event.target.tenure}   onChange={(event)=>setTenureamt(event.target.value)}/>
            <input type="number" placeholder='entre the interst' value={event.target.intrest_rate} onChange={(event)=>setIntrestamt(event.target.value)}/>
            <button onClick={calculateemi}>Submit Details</button>
            {/* <input type="number" placeholder='entre the loan amt ' value={loan_amount}  onChange={(e)=>setLoanamt(e.target.value)}/>
            <input type="number" placeholder='entre the tenure ' value={tenure}  onChange={(e)=>setTenureamt(e.target.value)}/>
            <input type="number" placeholder='entre the interst ' value={intrest_rate}  onChange={(e)=setIntrestamt(e.target.value)}/>
            <button onClick={calculateemi}>Submit Details</button> */}
            {/* if only emidetail ther e */}
            {emiDetails && (
                <div>
                    <h2> emi detail</h2>
                    <p>EMI val : <span>{emiDetails.emi}</span></p>
                    <p> Principal val:<span>{emiDetails.principal_amt}</span></p>
                    <p> Total Amount : <span> {emiDetails.total_amt}</span></p>
                    <p>Interest Amount: <span> {emiDetails.interest_amt}</span></p>
                </div>
            )}
            //popup wala div
            {enrollerData &&
           <div>
            <input type="text" placeholder="entere the name " name="name" value={e.target.value} onChange={(e)=>setEnrollerData({...enrollerData,name:e.target.value})}/>
            <input type="text" placeholder="entere the address " name="address" value={e.target.value} onChange={(e)=>setEnrollerData({...enrollerData,address:e.target.value})}/>
            <input type="text" placeholder="entere the pincode " name="pincode" value={e.target.value} onChange={(e)=>setEnrollerData({...enrollerData,pincode:e.target.value})}/>
            <input type="text" placeholder="entere the mobile " name="mobile" value={e.target.value} onChange={(e)=>setEnrollerData({...enrollerData,mobile:e.target.value})}/>
            <input type="text" placeholder="entere the email " name="email" value={e.target.value} onChange={(e)=>setEnrollerData({...enrollerData, email:e.target.value})}/>
            <button onClick={()=>setShowPage(false)}>Next </button>
         


           </div>}
           {enrollerData && <div>
            <input type="file" placeholder="entere the adhar file " name="adhar_card" value={e.target.value} onChange={handleFileChange}/>
            <input type="file" placeholder="entere the pan file " name="pan_card" value={e.target.value} onChange={handleFileChange} />
            <button onClick={handleEnrollerinfo}>Submit Enroller Info</button>
            </div>}


          

        
          
        </div>
      
    </div>
  )
}

export default Emicalcdashboard
